import logo from './logo.svg';
import './App.css';
import Header from './modules/Header';

function App() {
  return (
    <div className="App">
      <Header>
      </Header>

      <div className='App-generator'>
        <div>
          Text or quote
        </div>
        <button>Generate</button>
      </div>

      <div className='App-genres'>
        <div>Text or quote</div>
        <div className='Genres'>
          <div>Horror</div>
          <div>Romance</div>
          <div>Sci-fi</div>
          <div>Action</div>
          <div>Comedy</div>
          <div>Thriller</div>
        </div>
      </div>
    </div>
  );
}

export default App;
